import React, { useState } from 'react'

const ExpenseHistory = ({ type, note,Amount}) => {

    const [Color, setColor] = useState('')
    type==='+'?
    setColor('green') :
    setColor('pink')

    return (
        <div>
            <div className='w-5/6' style={{padding:'5px', margin:'auto', marginTop:'1rem', backgroundColor:Color, height:'2rem'}}>
                <span className='text-left float-left' style={{marginLeft:'10px'}}>{note}</span>
                <span className='float-right' style={{marginRight:'10px'}}>
                    {type} {Amount}
                </span>
            </div>
       </div>
    )
}

export default ExpenseHistory
